import React from "react";
import Person from "./Person";

const Persons = ({ persons, onDeleteClick }) => {
  return persons.map((person) => (
    <Person
      key={person.id}
      name={person.name}
      number={person.number}
      onDeleteClick={onDeleteClick}
    />
  ));
};

export default Persons;
